import React from "react";

function Projects() {
  return (
    <div className="flex flex-wrap flex-row m-auto justify-center align-center">
      <div className="p-5 m-1 border-2 rounded">Crypto Portal</div>
      <div className="p-5 m-1 border-2 rounded">Budget Tracker</div>
      <div className="p-5 m-1 border-2 rounded">Unrekt Crypto Tracker</div>
    </div>
  );
}

export default Projects;
